import React from "react";
import { CartProvider } from "./context/CartContext";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";

import Home from "./pages/Home";
import Category from "./pages/Category";
import ProductDetail from "./pages/ProductDetail";
import Cart from "./pages/Cart";
import Checkout from "./pages/Checkout";
import Admin from "./pages/Admin";
import Dashboards from "./pages/Dashboards";
import AdminLogin from "./pages/AdminLogin"; // ‚úÖ Import login page
import ProtectedRoute from "./components/ProtectedRoute"; // ‚úÖ Import protection

function App() {
  return (
    <Router>
      <Navbar />
      <main style={{ padding: "20px" }}>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/categoria/:name" element={<Category />} />
          <Route path="/producto/:id" element={<ProductDetail />} />
          <Route path="/cart" element={<Cart />} />
          <Route path="/checkout" element={<Checkout />} />

          {/* üîê Admin protected route */}
          <Route
            path="/admin"
            element={
              <ProtectedRoute>
                <Admin />
              </ProtectedRoute>
            }
          />

          return (
          <CartProvider>
            {/* Aqu√≠ va tu Router */}
            <Home />
            {/* <Cart /> u otras rutas */}
          </CartProvider>
          );

          {/* üîì Admin login */}
          <Route path="/admin-login" element={<AdminLogin />} />

          <Route path="/dashboards" element={<Dashboards />} />
        </Routes>
      </main>
      <Footer />
    </Router>
  );
}

export default App;
